import React from 'react';
import './VerticalNav.css';

const VerticalNav = () => {
  return (
    <nav className="vertical-nav">
      <ul>
        <li><i className="icon1"></i></li>
        <li><i className="icon2"></i></li>
        <li><i className="icon3"></i></li>
        <li><i className="icon4"></i></li>
      </ul>
    </nav>
  );
};

export default VerticalNav;
